import React from "react";
import { Container } from "react-bootstrap";
import Sdata from "./data";
function Box3() {
    return (<Container>
        <div grid>
            <div className="par2">
                {Sdata.map((val) => {
                    return (<>
                        <li>{val.title}</li>
                        <li>{val.skill}</li>
                        <li>{val.framework}</li>
                        <li>{val.language}</li>
                        <li></li>
                    </>)
                })}

       </div>

        </div>
    </Container>)
}
export default Box3
